        mHdltvinHandle << " , " <<  " \"dmem_i_V_q0\" :  \"" << dmem_i_V_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dmem_o_V_address0\" :  \"" << dmem_o_V_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dmem_o_V_ce0\" :  \"" << dmem_o_V_ce0.read() << "\" ";
